import React, { useEffect, useState } from "react";
import Contents from '../layout/Contents';
import ImageCont from '../includes/ImageCont';




function Image() {
  const [] = useState([]);

  useEffect(()=>{
    const requestOption = {
      method: "GET",
      redirect: "follow",
    };
    fetch("https://raw.githubusercontent.com/jjinvely/react-site1-3/main/src/assets/json/ImgText.json",
    requestOption).then((response)=>response.json())
    .then((result)=>{})

  })
  return (
    <>

        <Contents>
        <ImageCont skill={['section', 'nexon']}/>
      </Contents>
    </>
  );
}

export default Image;
